import { StatisticsItem } from "./FriendsItem";

export const StatisticsList = ({ items = [] }) => {
return <ul className="friend-list">
 {items.map((item => (
    <StatisticsItem 
    id={item.id}
    isOnline={item.isOnline}
    name={item.name}
    avatar={item.avatar}/>
 )))}
</ul>
}
